    """Return sorted unique common elements for two lists.
    >>> common([1, 4, 3, 34, 653, 2, 5], [5, 7, 1, 5, 9, 653, 121])
    [1, 5, 653]
    >>> common([5, 3, 2, 8], [3, 2])
    [2, 3]

    """
    common = set()
    for i in range(len(l1)):
        if l1[i] in common:
            common.remove(l1[i])
        if l2[i] in common:
            common.remove(l2[i])
    return list(common)

